import logo from './logo.svg';
import './App.css';
import {Component} from 'react';

class App extends Component {
    state = {
        posts: [
          {
              id: 1,
              title: 'titulo 1',
              bory: 'Corpo 1'
          },
          {
              id: 2,
              title: 'titulo 2',
              bory: 'Corpo 2'
          },
          {
              id: 3,
              title: 'titulo 3',
              bory: 'Corpo 3'
          }
        ]
    };

    render(){
        const { posts } =this.state;
        return (
            <div className="App">
                {posts.map(post => <h1> key={posts.id}>{post.title} </h1>)}
            </div>
        )
    }
} 
